local ADDON_NAME, LingkanUI = ...

LingkanUI.Install = LingkanUI.Install or {}

local Install = LingkanUI.Install

Install.Packs = Install.Packs or {}

local function MergeTable(destination, source)
    for key, value in pairs(source) do
        if type(value) == "table" then
            local destChild = destination[key]
            if type(destChild) ~= "table" then
                destChild = {}
                destination[key] = destChild
            end
            MergeTable(destChild, value)
        else
            destination[key] = value
        end
    end
end

-- Public API (used by Installer)
function Install:RegisterPack(key, pack)
    if not key or key == "" then
        return
    end
    if type(pack) ~= "table" then
        pack = {}
    end

    pack.key = key
    pack.name = pack.name or ("LingkanUI - " .. tostring(key))
    pack.overrides = pack.overrides or {}
    pack.steps = pack.steps or {}

    self.Packs[key] = pack
end

function Install:GetPack(key)
    return self.Packs and self.Packs[key]
end

function Install:GetOrderedPackKeys()
    if LingkanUI.Version and LingkanUI.Version.FLAVOR_ORDER then
        return LingkanUI.Version.FLAVOR_ORDER
    end
    return { "Retail", "Mists", "Wrath", "TBC", "ClassicEra" }
end

function Install:GetPackOptions()
    local orderedKeys = self:GetOrderedPackKeys()
    local options = {}
    for _, key in ipairs(orderedKeys) do
        local pack = self:GetPack(key)
        if pack then
            options[#options + 1] = { key = key, text = pack.name or key }
        end
    end
    return options
end

local function NotifyConfigChanged()
    if not LibStub then return end
    local reg = LibStub("AceConfigRegistry-3.0", true)
    if reg then
        reg:NotifyChange(ADDON_NAME)
    end
end

-- Applies the pack by:
-- 1) selecting+resetting a dedicated AceDB profile
-- 2) merging LingkanUI overrides
-- 3) running optional addon setup/profile steps (pcall-wrapped)
function Install:ApplyPack(key, opts)
    if not (LingkanUI.db and LingkanUI.db.profile) then
        return false, "Database not initialized"
    end

    local runSteps = true
    if type(opts) == "table" and opts.runSteps == false then
        runSteps = false
    end

    local pack = self:GetPack(key)
    if not pack then
        return false, "Unknown pack"
    end

    local profileName = pack.name or ("LingkanUI - " .. tostring(key))
    LingkanUI.db:SetProfile(profileName)
    LingkanUI.db:ResetProfile()

    if type(pack.overrides) == "table" then
        MergeTable(LingkanUI.db.profile, pack.overrides)
    end

    if runSteps and type(pack.steps) == "table" then
        for _, step in ipairs(pack.steps) do
            local stepFn = step
            local stepName
            if type(step) == "table" then
                stepFn = step.apply
                stepName = step.name
            end

            if type(stepFn) == "function" then
                local ok, result1, result2 = pcall(stepFn, LingkanUI, pack, key)
                if not ok then
                    return false, result1
                end

                if result1 == false then
                    return false, result2 or (stepName and (stepName .. " step failed") or "Step failed")
                end
            end
        end
    end

    NotifyConfigChanged()
    return true
end

function Install:ApplyAddonProfile(key, addonName)
    local pack = self:GetPack(key)
    if not pack then
        return false, "Unknown pack"
    end

    local function NormalizeProfileData(data)
        if addonName == "ElvUI" then
            return data
        end
        if type(data) == "table" and type(data[1]) == "string" and data[1] ~= "" and next(data, 1) == nil then
            return data[1]
        end
        return data
    end

    if not LingkanUI.API:IsAddOnEnabled(addonName) then
        return false, addonName .. " not enabled"
    end

    if not LingkanUI.API:IsAddOnLoaded(addonName) then
        return false, addonName .. " not loaded"
    end

    if addonName == "ElvUI" then
        local profileName = (pack.addons and pack.addons.ElvUI and pack.addons.ElvUI.profileName) or "LingkanUI"
        local profileData = NormalizeProfileData(pack.addons and pack.addons.ElvUI and pack.addons.ElvUI.profileData)
        local ok, err = self.Addons:ApplyElvUIProfile(profileName, profileData)
        if ok == false then
            return false, err or "ElvUI profile apply failed"
        end
        return true
    end

    if addonName == "BetterCooldownManager" then
        if key ~= "Retail" then
            return false, "BetterCooldownManager is only supported on Retail"
        end
        local profileName = (pack.addons and pack.addons.BetterCooldownManager and pack.addons.BetterCooldownManager.profileName) or "LingkanUI"
        local profileData = NormalizeProfileData(pack.addons and pack.addons.BetterCooldownManager and pack.addons.BetterCooldownManager.profileData)
        local ok, err = self.Addons:ApplyBetterCooldownManagerProfile(profileName, profileData)
        if ok == false then
            return false, err or "BetterCooldownManager profile apply failed"
        end
        return true
    end

    if addonName == "BigWigs" then
        local profileName = (pack.addons and pack.addons.BigWigs and pack.addons.BigWigs.profileName) or "LingkanUI"
        local profileData = NormalizeProfileData(pack.addons and pack.addons.BigWigs and pack.addons.BigWigs.profileData)
        local ok, err = self.Addons:ApplyBigWigsProfile(profileName, profileData)
        if ok == false then
            return false, err or "BigWigs profile apply failed"
        end
        return true
    end

    if addonName == "Details" then
        local profileName = (pack.addons and pack.addons.Details and pack.addons.Details.profileName) or "LingkanUI"
        local profileData = NormalizeProfileData(pack.addons and pack.addons.Details and pack.addons.Details.profileData)
        local ok, err = self.Addons:ApplyDetailsProfile(profileName, profileData)
        if ok == false then
            return false, err or "Details profile apply failed"
        end
        return true
    end

    return false, "Unknown addon"
end

-- Shared external-addon scaffolds (NaowhUI-style "setup steps")
local STEP_ELVUI = {
    name = "ElvUI",
    apply = function(_, pack)
        if not LingkanUI.API:IsAddOnLoaded("ElvUI") then
            return true
        end
        if not LingkanUI.API:IsAddOnEnabled("ElvUI") then
            return true
        end
        local profileName = (pack.addons and pack.addons.ElvUI and pack.addons.ElvUI.profileName) or "LingkanUI"
        local profileData = pack.addons and pack.addons.ElvUI and pack.addons.ElvUI.profileData
        local ok = Install.Addons:ApplyElvUIProfile(profileName, profileData)
        if ok == false then
            -- If ElvUI isn't loaded, SavedVariables won't exist. Treat as skipped.
            return true
        end
        return true
    end,
}

local STEP_BCM = {
    name = "BetterCooldownManager",
    apply = function(_, pack)
